create table user_ability_turn_record
(
    user_ability_turn_record_seq bigint auto_increment
        primary key,
    game_code                    varchar(255) null,
    success                      bit          null,
    target_user_seq              bigint       null,
    turn                         int          null,
    used_at                      datetime(6)  null,
    user_seq                     bigint       null
);

